import { Link } from "react-router-dom";
import "../LandingStyle.css";

export const LandingPage = () => {
  return (
    <div className="landing-container">
      <ul>
        <li>
          <Link to="/profile">Profile</Link>
        </li>
        <li>
          <Link to="/landing-page">Home</Link>
        </li>
      </ul>
      <h1>Welcome to Log Analyzer!</h1>
    </div>
  );
};
